y}}                        <h4>Response</h4>                        {{> message}}                    {{/either}}                {{/response}}                {{#if statusCodes}}                    {{> statusCodes}}                {{/if}}                {{#if codeExamples}}                    {{> codeExamples}}                {{/if}}             </div>         </div>        {{/endpoints}}    </script>    <script type="text/html" id="swank-url-parameters-template">        <h4>Url Parameters</h4>        <table class="table table-zebra">            <tbody>                {{#urlParameters}}                <tr>                    <td class="value"><strong>{{name}}</strong></td>                    <td>                        <p><code>{{type}}</code>{{{comments}}}</p>                        {{#options}}                            {{> options}}                        {{/options}}                    </td>                </tr>                {{/urlParameters}}            </tbody>        </table>        </script>    <script type="text/html" id="swank-querystring-template">        <h4>Querystring</h4>        <table class="table table-zebra">            <tbody>                {{#querystringParameters}}                <tr>                    <td class="value"><strong>{{name}}</strong></td>                    <td>                        <p><code>{{type}}</code>                        {{#required}}<span class="badge swank-required">Required</span>{{/required}}                        {{^required}}<span class="badge swank-optional">Optional</span>{{/required}}                        {{#multipleAllowed}}<span class="badge">Multiple Allowed</span>{{/multipleAllowed}}                        {{^required}}                        {{#if defaultValue}}                        <span class="label label-default">Default: <code>{{defaultValue}}</code></span>                        {{/if}}                        {{/required}}  <span class="glyphicon glyphicon-copy"></span>                                </button>                        </th>                        <th></th>                    </tr>                </thead>                <tbody>                    {{#body}}                    <tr>                        <td class="swank-sample-data swank-sample-data-json">{{> jsonMessage}}</td>                        <td class="swank-sample-data swank-sample-data-xml hide">{{> xmlMessage}}</td>                        <td>{{> messageDescription}}</td>                    </tr>                    {{/body}}                </tbody>            </table>                {{/if}}    </script>    <script type="text/html" id="swank-message-description-template">        {{^isClosing}}            {{^isDictionaryEntry}}                <p>                    {{#isSimpleType}}<code>{{typeName}}</code>{{/isSimpleType}}                    {{#isDictionary}}<span class="badge">Dictionary</span>{{/isDictionary}}                    {{#isArray}}<span class="badge">Array</span>{{/isArray}}                    {{#isMember}}                        {{#required}}<span class="badge swank-required">Required</span>{{/required}}                        {{#optional}}<span class="badge swank-optional">Optional</span>{{/optional}}                        {{#if defaultValue}}                            <span class="badge badge-inverse">Default: <code>{{defaultValue}}</code></span>                        {{/if}}                    {{/isMember}}                    {{{comments}}}                </p>                {{#isDeprecated}}                    <div class="alert alert-danger">{{{deprecationMessage}}}</div>                {{/isDeprecated}}                {{#options}}{{> options}}{{/options}}            {{/isDictionaryEntry}}            {{#isDictionaryEntry}}                <div class="panel panel-default">                    {{#with dictionaryKey}}                        <div class="panel-heading {{#unless options}}empty{{/unless}}">                            <span class="label label-default">Key</span>                            <code>{{{typeName}}}</code>                            {{{comments}}}                        </div>                        {{#options}}{{> options}}{{/options}}                    {{/with}}                </div>                {{#either typeName comments}}                    <div class="panel panel-default">                        <div class="panel-heading {{#unless options}}empty{{/unless}}">                            <span class="label label-default">Value</span>                            {{#isSimpleType}}<code>{{{typeName}}}</code>{{/isSimpleType}}                            {{#isDictionary}}<span class="badge">Dictionary</span>{{/isDictionary}}                            {{#isArray}}<span class="badge">Array</span>{{/isArray}}                            {{{comments}}}                        </div>                        {{#options}}{{> options}}{{/options}}                    </div>                {{/either}}            {{/isDictionaryEntry}}        {{/isClosing}}    </script>    <script type="text/html" id="swank-json-message-template">        <span class="sample-code-whitespace">{{{replace whitespace ' ' '&nbsp;'}}}</span>        {{^isClosing}}            {{#isMember}}                <span class="swank-string">"{{name}}"</span>:&nbsp;            {{/isMember}}            {{#isDictionaryEntry}}                <span class="swank-string">"<span style="font-style: italic">[{{name}}]</span>"</span>:&nbsp;            {{/isDictionaryEntry}}        {{/isClosing}}        {{#isSimpleType}}            {{#isString}}<span class="swank-string">"{{sampleValue}}"</span>{{/isString}}            {{#isBoolean}}<span class="swank-primitive">{{sampleValue}}</span>{{/isBoolean}}            {{#isNumeric}}<span class="swank-primitive">{{sampleValue}}</span>{{/isNumeric}}            {{#isDateTime}}<span class="swank-string">"{{sampleValue}}"</span>{{/isDateTime}}            {{#isDuration}}<span class="swank-string">"{{sampleValue}}"</span>{{/isDuration}}            {{#isGuid}}<span class="swank-string">"{{sampleValue}}"</span>{{/isGuid}}        {{/isSimpleType}}        {{#isOpening}}            {{#isArray}}[{{/isArray}}            {{#isComplexType}}&#123;{{/isComplexType}}            {{#isDictionary}}&#123;{{/isDictionary}}        {{/isOpening}}        {{#isClosing}}            {{#isArray}}]{{/isArray}}            {{#isComplexType}}&#125;{{/isComplexType}}            {{#isDictionary}}&#125;{{/isDictionary}}        {{/isClosing}}        {{#isMember}}            {{^isOpening}}                {{^isLastMember}},{{/isLastMember}}            {{/isOpening}}        {{/isMember}}    </script>    <script type="text/html" id="swank-xml-message-template">        <span class="sample-code-whitespace">{{{replace whitespace ' ' '&nbsp;'}}}</span>        <span class="swank-bracket">&lt;            {{~#isClosing~}}/{{~/isClosing~}}        </span><span class="swank-name" style="{{#isDictionaryEntry}}font-style: italic{{/isDictionaryEntry}}">            {{~#isDictionaryEntry~}}[{{name}}]{{~/isDictionaryEntry~}}            {{~^isDictionaryEntry~}}{{name}}{{~/isDictionaryEntry~}}        </span><span class="swank-bracket">&gt;</span>        {{#isSimpleType}}            {{sampleValue}}            <span class="swank-bracket">&lt;/</span><span class="swank-name" style="{{#isDictionaryEntry}}font-style: italic{{/isDictionaryEntry}}">                {{~#isDictionaryEntry~}}[{{name}}]{{~/isDictionaryEntry~}}                {{~^isDictionaryEntry~}}{{name}}{{~/isDictionaryEntry~}}            </span><span class="swank-bracket">&gt;</span>        {{/isSimpleType}}    </script>    <script type="text/html" id="swank-status-codes-template">        <h4>Status Codes</h4>        <table class="table table-zebra">            <tbody>                {{#statusCodes}}                <tr>                    <td class="value"><strong>{{code}} {{name}}</strong></td>                    <td><p>{{{comments}}}</p></td>                </tr>                {{/statusCodes}}            </tbody>        </table>    </script>    <script type="text/html" id="swank-code-examples-template">        <h4>Examples</h4>        <ul class="nav nav-tabs swank-code-example-selector" role="tablist">            {{#codeExamples}}            <li {{#equals index '0'}}class="active"{{/equals}}>                <a data-language="{{language}}" href="#code-example-{{../id}}-{{index}}" data-toggle="tab">{{name}}</a>            </li>            {{/codeExamples}}        </ul>        <div class="tab-content">            {{#codeExamples}}            <div class="tab-pane {{#equals index '0'}}active{{/equals}}" id="code-example-{{../id}}-{{index}}">                {{{comments}}}                <div>                    <button class="btn swank-code-example-copy"                         data-clipboard-target="#code-example-{{../id}}-{{index}}-content"                        data-placement="bottom" data-original-title="Copied">                    <span class="glyphicon glyphicon-copy"></span>                    </button>                    <pre class="swank-code-example {{language}}"><code id="code-example-{{../id}}-{{index}}-content">                        {{~#with example~}}                            {{{replace . '\r\n' '&lt;br/>'}}}                        {{~/with~}}                    </code></pre>                </div>            </div>            {{/codeExamples}}        </div>    </script>    <script type="text/html" id="swank-options-template">        <table class="table table-zebra swank-options">            <thead><tr><th>Possible Values</th></tr></thead>            <tbody>            {{#if comments}}            <tr>                <td>{{{comments}}}</td>            </tr>            {{/if}}            {{#options}}            <tr>                <td>                    {{^equals name value}}<b>{{name}}</b>:{{/equals}}<code>{{value}}</code>{{{comments}}}                </td>             </tr>            {{/options}}            </tbody>        </table>    </script></html>
